import logo from './logo.svg';
import './App.css';

let text = "The betterment of the world can be accomplished..."
let Author = "Baha'u'llah"
function quoteBox(props){
  return (
    <div id="quote-box">
      {quoteText()}
      {authorName()}
    </div>
  )
}

function quoteText(){
  return (
    <div id='text' >{text}</div>
  )
}

function authorName(){
  return (
    <div >-{Author}</div>
  )
}
class NewQuote extends React.Component {
  constructor(props){
    super(props);
  }
  render() {
    return (

      <div id="new-quote">This button gives a new quote</div>
    );
  }
}

class Fruits extends React.Component {
  constructor(props) {
